import React from "react";
import ReactDOM from "react-dom";
// import "./index.css";

let crnDate = new Date(2021, 8, 13, 14);
crnDate = crnDate.getHours();
let greeting = "";
let cssStyle = {};

if (crnDate >= 1 && crnDate < 12) {
  greeting = "Good Morning";
  cssStyle.color = "green";
} else if (crnDate >= 12 && crnDate < 19){
  greeting = "Good Afternon";
  cssStyle.color = "blue";
}else{
  greeting = "Good Night";
  cssStyle.color = "black";

}

ReactDOM.render(
  <>
  <div>
  <h1>Hello!! <span style = {cssStyle}> {greeting} </span></h1>
  </div>
  </>,

  document.getElementById("root")
)
